import{_ as o,c as s,o as c,ak as e}from"./chunks/framework.CmzJUe0_.js";const u=JSON.parse('{"title":"Nacos面试题总结","description":"","frontmatter":{"title":"Nacos面试题总结","date":"2023-12-05T00:00:00.000Z","sidebar":"auto","categories":["面试"],"tags":["Nacos"]},"headers":[],"relativePath":"blogs/面试/Nacos面试题总结.md","filePath":"blogs/面试/Nacos面试题总结.md"}'),t={name:"blogs/面试/Nacos面试题总结.md"};function l(n,a,i,r,d,h){return c(),s("div",null,a[0]||(a[0]=[e('<p>[toc]</p><h1 id="nacos面试题总结" tabindex="-1">Nacos面试题总结 <a class="header-anchor" href="#nacos面试题总结" aria-label="Permalink to &quot;Nacos面试题总结&quot;">​</a></h1><h2 id="nacos作为注册中心提供的核心功能是什么" tabindex="-1">Nacos作为注册中心提供的核心功能是什么？ <a class="header-anchor" href="#nacos作为注册中心提供的核心功能是什么" aria-label="Permalink to &quot;Nacos作为注册中心提供的核心功能是什么？&quot;">​</a></h2><ul><li>服务注册：当服务配置了nacos后。服务启动后，服务会调用nacos的接口，将服务自身的信息注册到nacos中。</li><li>服务发现: 服务会定时调用nacos的接口，获取nacos中的服务注册表信息。并保存在服务本地缓存中。</li><li>服务注销：当服务停止运行的时候，服务会调用nacos的注销接口，将服务自身的信息从nacos中删除。</li><li>服务心跳：服务会定时调用nacos的心跳接口，来通知nacos，服务处于可用状态。</li><li>服务同步：Nacos集群之间会互相同步服务注册表信息，用来保证数据的一致性。</li></ul><h2 id="nacos作为配置中心的原理" tabindex="-1">Nacos作为配置中心的原理? <a class="header-anchor" href="#nacos作为配置中心的原理" aria-label="Permalink to &quot;Nacos作为配置中心的原理?&quot;">​</a></h2><h2 id="nacos如何实现配置环境隔离的" tabindex="-1">Nacos如何实现配置环境隔离的? <a class="header-anchor" href="#nacos如何实现配置环境隔离的" aria-label="Permalink to &quot;Nacos如何实现配置环境隔离的?&quot;">​</a></h2><p>Nacos配置中心有三个核心要点：命名空间Namespace,分组Group,配置集DataId。通过这三个要点来实现配置环境的隔离。</p><p>即namespace-&gt; group -&gt; dataID</p><ul><li>namespace 命令空间相当于环境，如生产环境，开发环境。不同namespace之间相互隔离。</li><li>group 相当于项目。如医疗项目，电商项目等。</li><li>dataID 相当于某个具体的服务。即用户服务，订单服务等</li></ul><h2 id="nacos中注册的服务有哪些" tabindex="-1">Nacos中注册的服务有哪些 ? <a class="header-anchor" href="#nacos中注册的服务有哪些" aria-label="Permalink to &quot;Nacos中注册的服务有哪些 ?&quot;">​</a></h2><p>Nacos注册的服务分为两种类型：</p><ul><li>临时实例：如果服务宕机超过一定时间，会从服务列表剔除，默认的类型。</li><li>非临时实例：如果服务宕机，不会从服务列表剔除，也可以叫永久服务实例。</li></ul><h2 id="项目启动的时候是先加载本地配置文件还是nacos中的配置文件" tabindex="-1">项目启动的时候是先加载本地配置文件还是Nacos中的配置文件 ? <a class="header-anchor" href="#项目启动的时候是先加载本地配置文件还是nacos中的配置文件" aria-label="Permalink to &quot;项目启动的时候是先加载本地配置文件还是Nacos中的配置文件 ?&quot;">​</a></h2><p>先加载本地配置文件,若在本地配置文件中配置了Nacos配置中心地址。那么会加载Nacos配置中心中的文件。</p><h2 id="nacos如何实现配置的热更新" tabindex="-1">Nacos如何实现配置的热更新? <a class="header-anchor" href="#nacos如何实现配置的热更新" aria-label="Permalink to &quot;Nacos如何实现配置的热更新?&quot;">​</a></h2>',15)]))}const p=o(t,[["render",l]]);export{u as __pageData,p as default};
